        public static MultiPrecision<N12> Value(MultiPrecision<N12> p, bool is_complementary = false) {
            if (is_complementary) {
                MultiPrecision<N12> y = (p < 0.5) ? CCDF(p) : CDF(1.0 - p);

                return y;
            }
            else {
                MultiPrecision<N12> y = (p < 0.5) ? CDF(p) : CCDF(1.0 - p);

                return y;
            }
        }

        private static MultiPrecision<N12> CDF(MultiPrecision<N12> p) {
            if (p.Exponent < -16384 || p > 0.5) {
                throw new ArgumentOutOfRangeException(nameof(p));
            }

            MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(p);

            MultiPrecision<N12> lambda;
            if (logp <= -4096) {
                lambda = ApproxUtil.Pade(-4096 - logp, pade_cdf_expm4096_16384);
            }
            else if (logp <= -1024) {
                lambda = ApproxUtil.Pade(-1024 - logp, pade_cdf_expm1024_4096);
            }
            else if (logp <= -256) {
                lambda = ApproxUtil.Pade(-256 - logp, pade_cdf_expm256_1024);
            }
            else if (logp <= -64) {
                lambda = ApproxUtil.Pade(-64 - logp, pade_cdf_expm64_256);
            }
            else if (logp <= -16) {
                lambda = ApproxUtil.Pade(-16 - logp, pade_cdf_expm16_64);
            }
            else if (logp <= -4) {
                lambda = ApproxUtil.Pade(-4 - logp, pade_cdf_expm4_16);
            }
            else if (logp <= -2) {
                lambda = ApproxUtil.Pade(-2 - logp, pade_cdf_expm2_4);
            }
            else {
                lambda = ApproxUtil.Pade(-1 - logp, pade_cdf_expm1_2);
            }

            return lambda;
        }

        private static MultiPrecision<N12> CCDF(MultiPrecision<N12> p) {
            if (p.Sign == Sign.Minus || p > 0.5) {
                throw new ArgumentOutOfRangeException(nameof(p));
            }
            if (p.Exponent <= -320) {
                return 1 / p;
            }

            MultiPrecision<N12> logp = MultiPrecision<N12>.Log2(p);

            MultiPrecision<N12> scaled_lambda;
            if (logp <= -256) {
                scaled_lambda = ApproxUtil.Pade(-256 - logp, pade_ccdf_expm256_320);
            }
            else if (logp <= -128) {
                scaled_lambda = ApproxUtil.Pade(-128 - logp, pade_ccdf_expm128_256);
            }
            else if (logp <= -64) {
                scaled_lambda = ApproxUtil.Pade(-64 - logp, pade_ccdf_expm64_128);
            }
            else if (logp <= -32) {
                scaled_lambda = ApproxUtil.Pade(-32 - logp, pade_ccdf_expm32_64);
            }
            else if (logp <= -16) {
                scaled_lambda = ApproxUtil.Pade(-16 - logp, pade_ccdf_expm16_32);
            }
            else if (logp <= -8) {
                scaled_lambda = ApproxUtil.Pade(-8 - logp, pade_ccdf_expm8_16);
            }
            else if (logp <= -4) {
                scaled_lambda = ApproxUtil.Pade(-4 - logp, pade_ccdf_expm4_8);
            }
            else if (logp <= -2) {
                scaled_lambda = ApproxUtil.Pade(-2 - logp, pade_ccdf_expm2_4);
            }
            else {
                scaled_lambda = ApproxUtil.Pade(-1 - logp, pade_ccdf_expm1_2);
            }

            MultiPrecision<N12> lambda = scaled_lambda / p;

            return lambda;
